from collections import defaultdict

class Solution:
    def assignElements(self, groups: List[int], elements: List[int]) -> List[int]:
        s = set()
        dic = defaultdict(int)
        for i, e in enumerate(elements):
            if e in s:
                continue
            t = 1
            while e * t <= 100000:
                if e * t not in dic:
                    dic[e * t] = i
                t += 1
            s.add(e)
        res = []
        for g in groups:
            if g in dic:
                res.append(dic[g])
            else:
                res.append(-1)
        return res

