        max_value = max(groups)


        mapper = collections.defaultdict(list)

        for i,x in enumerate(groups):
            mapper[x].append(i)

        seen = set()
        for j in range(len(elements)):
            if elements[j] in seen:
                continue
            seen.add(elements[j])
            curr = elements[j]
