class Solution:
    def assignElements(self, groups: List[int], elements: List[int]) -> List[int]:
        seen = set()
        T = max(groups)
        pre = [-1] * (T + 1)
        for u, e in enumerate(elements):
            if e in seen:
                continue
            seen.add(e)
            i = e
            while i <= T:
                if pre[i] == -1:
                    pre[i] = u
                i += e

        ans = list()
        for o in groups:
            ans.append(pre[o])
        return ans
